import React from 'react'
import styled from "@emotion/styled"

const ComponenteHeader = styled.header`
    background-color: #26C6DA;
    padding: 10px;
    font-weight: bold;
    color: #ffffff
`;

const Header = ({titulo}) => {
    return (
        <ComponenteHeader> 
            <h2>{titulo}</h2>
        </ComponenteHeader>
    )
}

export default Header;
